def MatrixSpiral(strArr):
  
  rows = len(strArr)
  strArr = [x[1:-1].split(',') for x in strArr]
  cols = len(strArr[0])
  row_top = 1
  row_bot = rows-1
  col_left = 0
  col_right = cols-1
  d = 'R'
  row = 0
  col = 0
  output = []
  for i in range(rows*cols):
        
    output.append(str(int(strArr[row][col])))
       
    if d == 'R':
      if col == col_right: 
        d = 'D'
        col_right += -1
      else: col += 1
    if d == 'D':
      if row == row_bot:
        d = 'L'
        row_bot += -1
      else: row += 1
    if d == 'L':
      if col == col_left:
        d = 'U'
        col_left += 1
      else: col += -1
    if d == 'U':
      if row == row_top:
        d = 'R'
        row_top += 1
        col += 1
      else: row += -1
  print(', '.join(output))

